import "./Table.css";
import { parseLabel } from "./../../utils/AppUtils";
import { Table as TableComp } from "antd";

const Table = ({ branches }) => {
  function getColumns() {
    let columns = [];
    if (branches.length) {
      Object.keys(branches[0]).forEach((key) => {
        columns.push({
          title: parseLabel(key),
          dataIndex: key,
          key: key,
        });
      });
    }
    return columns;
  }

  function formatData() {
    return branches.map((branch) => {
      branch["bank_id"] = branch["bank_id"];
      return branch;
    });
  }

  return (
    <TableComp
      columns={getColumns()}
      dataSource={formatData()}
      rowKey="ifsc"
      className="table"
    />
  );
};

export default Table;
